  const [tinh, setTinh] = useState([]);
  const [ngheNghiep, setNgheNghiep] = useState([]);
  const [trangThaiCCCD, setTrangThaiCCCD] = useState([]);
  const [ketHonNam, setKetHonNam] = useState([]);
  const [ketHonTinh, setKetHonTinh] = useState([]);
  const [lyHonNam, setLyHonNam] = useState([]);
  const [xeLoai, setXeLoai] = useState([]);
  const [xeHang, setXeHang] = useState([]);
  const [xeNam, setXeNam] = useState([]);
  const [truLoai, setTruLoai] = useState([]);
  const [truTrangThai, setTruTrangThai] = useState([]);
  const [truTinh, setTruTinh] = useState([]);
  const [sinhNam, setSinhNam] = useState([]);
  const [sinhNoi, setSinhNoi] = useState([]);
  const [tuNam, setTuNam] = useState([]);
  const [tuNguyenNhan, setTuNguyenNhan] = useState([]);
  const [tuNoi, setTuNoi] = useState([]);
  const [hoKhauTinh, setHoKhauTinh] = useState([]);
  const [hoKhauKichThuoc, setHoKhauKichThuoc] = useState({});
  const [taiKhoanRole, setTaiKhoanRole] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    let isMounted = true;
    const fetchData = async () => {
      setLoading(true);
      setError(null);
      try {
        const [
          gioiTinhRes, honNhanRes, doTuoiRes, tinhRes, ngheNghiepRes, trangThaiCCCDRes,
          ketHonNamRes, ketHonTinhRes, lyHonNamRes,
          xeLoaiRes, xeHangRes, xeNamRes,
          truLoaiRes, truTrangThaiRes, truTinhRes,
          sinhNamRes, sinhNoiRes,
          tuNamRes, tuNguyenNhanRes, tuNoiRes,
          hoKhauTinhRes, hoKhauKichThuocRes,
          taiKhoanRoleRes
        ] = await Promise.all([
          axios.get('http://localhost:5000/api/thongke/gioitinh'),
          axios.get('http://localhost:5000/api/thongke/honnhan'),
          axios.get('http://localhost:5000/api/thongke/dotuoi'),
          axios.get('http://localhost:5000/api/thongke/tinh'),
          axios.get('http://localhost:5000/api/thongke/nghenghiep'),
          axios.get('http://localhost:5000/api/thongke/trangthaicccd'),
          axios.get('http://localhost:5000/api/thongke/kethonnam'),
          axios.get('http://localhost:5000/api/thongke/kethontinh'),
          axios.get('http://localhost:5000/api/thongke/lyhonnam'),
          axios.get('http://localhost:5000/api/thongke/xeloai'),
          axios.get('http://localhost:5000/api/thongke/xehang'),
          axios.get('http://localhost:5000/api/thongke/xenam'),
          axios.get('http://localhost:5000/api/thongke/truloai'),
          axios.get('http://localhost:5000/api/thongke/trutrangthai'),
          axios.get('http://localhost:5000/api/thongke/trutinh'),
          axios.get('http://localhost:5000/api/thongke/sinhnam'),
          axios.get('http://localhost:5000/api/thongke/sinhnoi'),
          axios.get('http://localhost:5000/api/thongke/tunam'),
          axios.get('http://localhost:5000/api/thongke/tunguyennhan'),
          axios.get('http://localhost:5000/api/thongke/tunoi'),
          axios.get('http://localhost:5000/api/thongke/hokhautinh'),
          axios.get('http://localhost:5000/api/thongke/hokhaukichthuoc'),
          axios.get('http://localhost:5000/api/thongke/taikhoanrole')
        ]);
        if (isMounted) {
          setGioiTinh(gioiTinhRes.data);
          setHonNhan(honNhanRes.data);
          setDoTuoi(doTuoiRes.data);
          setTinh(tinhRes.data);
          setNgheNghiep(ngheNghiepRes.data);
          setTrangThaiCCCD(trangThaiCCCDRes.data);
          setKetHonNam(ketHonNamRes.data);
          setKetHonTinh(ketHonTinhRes.data);
          setLyHonNam(lyHonNamRes.data);
          setXeLoai(xeLoaiRes.data);
          setXeHang(xeHangRes.data);
          setXeNam(xeNamRes.data);
          setTruLoai(truLoaiRes.data);
          setTruTrangThai(truTrangThaiRes.data);
          setTruTinh(truTinhRes.data);
          setSinhNam(sinhNamRes.data);
          setSinhNoi(sinhNoiRes.data);
          setTuNam(tuNamRes.data);
          setTuNguyenNhan(tuNguyenNhanRes.data);
          setTuNoi(tuNoiRes.data);
          setHoKhauTinh(hoKhauTinhRes.data);
          setHoKhauKichThuoc(hoKhauKichThuocRes.data || {});
          setTaiKhoanRole(taiKhoanRoleRes.data);
        }
      } catch (error) {
        if (isMounted) {
          console.error("Lỗi khi tải dữ liệu thống kê:", error);
          setError("Có lỗi xảy ra khi tải dữ liệu. Vui lòng kiểm tra console để biết thêm chi tiết.");
        }
      } finally {
        if (isMounted) {
          setLoading(false);
        }
      }
    };
    fetchData();
    return () => {
      isMounted = false;
    };
  }, []);

  const StatCard = ({ title, data, isObject = false }) => (
    <div style={{ 
      background: '#ffffff',
      border: '1px solid #dee2e6',
      borderRadius: '5px',
      padding: '20px',
      marginBottom: '20px'
    }}>
      <h3 style={{ 
        marginBottom: '15px', 
        fontSize: '1.25em',
        fontWeight: '600',
        color: '#343a40'
      }}>{title}</h3>

      {loading ? (
        <div style={{ textAlign: 'center', color: '#6c757d' }}>
          Đang tải...
        </div>
      ) : error ? (
        <div style={{ textAlign: 'center', color: '#dc3545' }}>
          {error}
        </div>
      ) : (
        <div style={{ display: 'flex', flexDirection: 'column', gap: '10px' }}>
          {isObject ? (
            Object.entries(data).map(([key, value]) => {
              let displayKey = key;
              let displayValue = value !== null && value !== undefined ? value : 0;
              if (title.includes('Độ tuổi')) {
                displayKey = key === 'Duoi 18' ? 'Dưới 18 tuổi' : 
                             key === 'Tren 50' ? 'Trên 50 tuổi' : 
                             `${key} tuổi`;
              } else if (title.includes('Kích thước Hộ khẩu')) {
                displayKey = key === 'so_ho_khau' ? 'Số hộ khẩu' : 'Kích thước trung bình';
                if (key === 'kich_thuoc_trung_binh') {
                  displayValue = displayValue.toFixed(2);
                }
              }
              return (
                <div key={key} style={{ 
                  background: '#f8f9fa',
                  padding: '10px',
                  borderRadius: '5px',
                  display: 'flex',
                  justifyContent: 'space-between',
                  alignItems: 'center'
                }}>
                  <span style={{ fontSize: '1em', color: '#495057' }}>
                    {displayKey}
                  </span>
                  <span style={{ 
                    fontSize: '1.2em', 
                    fontWeight: '600',
                    color: '#212529',
                    background: '#e9ecef',
                    padding: '3px 10px',
                    borderRadius: '15px'
                  }}>
                    {displayValue}
                  </span>
                </div>
              );
            })
          ) : (
            (data || []).map((item, index) => {
              const categoryKey = Object.keys(item).find(k => k !== 'so_luong');
              const categoryValue = item[categoryKey] || 'Không xác định';
              const count = item.so_luong || 0;
              return (
                <div key={index} style={{ 
                  background: '#f8f9fa',
                  padding: '10px',
                  borderRadius: '5px',
                  display: 'flex',
                  justifyContent: 'space-between',
                  alignItems: 'center'
                }}>
                  <span style={{ fontSize: '1em', color: '#495057' }}>
                    {categoryValue}
                  </span>
                  <span style={{ 
                    fontSize: '1.2em', 
                    fontWeight: '600',
                    color: '#212529',
                    background: '#e9ecef',
                    padding: '3px 10px',
                    borderRadius: '15px'
                  }}>
                    {count}
                  </span>
                </div>
              );
            })
          )}
        </div>
      )}
    </div>
  );

  return (
    <div style={{ padding: '20px', maxWidth: '1200px', margin: '0 auto' }}>
      <h2 style={{
        fontSize: '1.75em',
        marginBottom: '20px',
        color: '#212529',
        textAlign: 'center'
      }}>
        Thống kê Dân số
      </h2>

      <h3 style={{ fontSize: '1.5em', margin: '20px 0 10px', color: '#343a40' }}>Thống kê Công dân</h3>
      <div style={{ 
        display: 'grid', 
        gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', 
        gap: '20px',
        marginBottom: '30px'
      }}>
        <StatCard title="Theo Giới tính" data={gioiTinh} />
        <StatCard title="Theo Tình trạng Hôn nhân" data={honNhan} />
        <StatCard title="Theo Độ tuổi" data={doTuoi} isObject={true} />
        <StatCard title="Theo Tỉnh" data={tinh} />
        <StatCard title="Theo Nghề nghiệp" data={ngheNghiep} />
        <StatCard title="Theo Trạng thái CCCD" data={trangThaiCCCD} />
      </div>

      <h3 style={{ fontSize: '1.5em', margin: '20px 0 10px', color: '#343a40' }}>Thống kê Hôn nhân</h3>
      <div style={{ 
        display: 'grid', 
        gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', 
        gap: '20px',
        marginBottom: '30px'
      }}>
        <StatCard title="Kết hôn theo Năm" data={ketHonNam} />
        <StatCard title="Kết hôn theo Tỉnh" data={ketHonTinh} />
        <StatCard title="Ly hôn theo Năm" data={lyHonNam} />
      </div>

      <h3 style={{ fontSize: '1.5em', margin: '20px 0 10px', color: '#343a40' }}>Thống kê Xe</h3>
      <div style={{ 
        display: 'grid', 
        gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', 
        gap: '20px',
        marginBottom: '30px'
      }}>
        <StatCard title="Xe theo Loại" data={xeLoai} />
        <StatCard title="Xe theo Hãng" data={xeHang} />
        <StatCard title="Xe theo Năm đăng ký" data={xeNam} />
      </div>

      <h3 style={{ fontSize: '1.5em', margin: '20px 0 10px', color: '#343a40' }}>Thống kê Trú</h3>
      <div style={{ 
        display: 'grid', 
        gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', 
        gap: '20px',
        marginBottom: '30px'
      }}>
        <StatCard title="Trú theo Loại" data={truLoai} />
        <StatCard title="Trú theo Trạng thái" data={truTrangThai} />
        <StatCard title="Trú theo Tỉnh" data={truTinh} />
      </div>

      <h3 style={{ fontSize: '1.5em', margin: '20px 0 10px', color: '#343a40' }}>Thống kê Sinh</h3>
      <div style={{ 
        display: 'grid', 
        gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', 
        gap: '20px',
        marginBottom: '30px'
      }}>
        <StatCard title="Sinh theo Năm" data={sinhNam} />
        <StatCard title="Sinh theo Nơi" data={sinhNoi} />
      </div>

      <h3 style={{ fontSize: '1.5em', margin: '20px 0 10px', color: '#343a40' }}>Thống kê Tử</h3>
      <div style={{ 
        display: 'grid', 
        gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', 
        gap: '20px',
        marginBottom: '30px'
      }}>
        <StatCard title="Trung bình số người mất mỗi năm" data={tuNam} />
        <StatCard title="Nguyên nhân mất" data={tuNguyenNhan} />
        <StatCard title="Nơi mất" data={tuNoi} />
      </div>

      <h3 style={{ fontSize: '1.5em', margin: '20px 0 10px', color: '#343a40' }}>Thống kê Hộ khẩu</h3>
      <div style={{ 
        display: 'grid', 
        gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', 
        gap: '20px',
        marginBottom: '30px'
      }}>
        <StatCard title="Hộ khẩu theo Tỉnh" data={hoKhauTinh} />
        <StatCard title="Số người trung bình mỗi nhà" data={hoKhauKichThuoc} isObject={true} />
      </div>

      <h3 style={{ fontSize: '1.5em', margin: '20px 0 10px', color: '#343a40' }}>Thống kê Tài khoản</h3>
      <div style={{ 
        display: 'grid', 
        gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', 
        gap: '20px',
        marginBottom: '30px'
      }}>
        <StatCard title="Tài khoản theo Role" data={taiKhoanRole} />
      </div>
    </div>
  );
}

export default ThongKe;
